import ImageSubject from '../logo512.png';
export default function TopSubject() {
  return (
    <div className="py-1 text-center" xs="3">
      <h4 className="text-light d-flex justify-content-center align-items-center mt-2">
        <img src={ImageSubject} alt="ddd" className="w-20" />
      </h4>
    </div>
  );
}
